import { InputBase } from '@mui/material';
const input = <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)', input: { padding: '12px' } }} />;

export const fields1 = [
  {
    field: 'Name',
    required: '*',
    input: input,
  },
  {
    field: 'Gender',
    required: '*',
    input: input,
  },
  {
    field: 'Mother Name',
    input: input,
  },
  {
    field: 'Date of birth',
    input: input,
    required: '*',
  },
  {
    field: 'Place of birth',
    input: input,
  },
  {
    field: 'KTP No.',
    input: input,
    required: '*',
  },
  {
    field: 'Natoinal Card ID',
    input: input,
    required: '*',
  },
  {
    field: 'Home Address 1',
    input: input,
  },
  {
    field: 'Home Address 2',
    input: input,
  },
];

export const fields2 = [
  {
    field: 'Mobile No.',
    input: input,
  },
  {
    field: 'Tel No.',
    input: input,
  },
  {
    field: 'Marriage Status',
    input: input,
  },
  {
    field: 'Bank Card No.',
    input: input,
  },
  {
    field: 'Bank Account No.',
    input: input,
  },
  {
    field: 'Bank Name',
    input: input,
  },
  {
    field: 'Family Card Number',
    input: input,
  },
  {
    field: 'Safety Insurance No.',
    input: input,
  },
  {
    field: 'Health Insurance No.',
    input: input,
  },
];
